               dot_sub_left = ((((float)left_10[ten_left_times - 1][1] - (float)left_line[left_dot - 1][1]))) / (((float)left_10[ten_left_times - 1][0] - (float)left_line[left_dot - 1][0]));
               left_j_stay = left_line[left_dot - 1][1];
