	       if(add[add_times-1][0] != right_line[right_dot - 1][0])
               dot_sub_right = (float)(add[add_times-1][1] - right_line[right_dot - 1][1]) / (float)(add[add_times-1][0] - right_line[right_dot - 1][0]);
              else dot_sub_right=0;
